                    catch (Exception ex)
                    when (errorMask != null)
                    {
                        errorMask.ReportException(ex);
                    }
                    finally
                    {
                        errorMask?.PopIndex();
                    }
                    break;
                case "Modifier":
                    try
                    {
                        errorMask?.PushIndex((int)Relation_FieldIndex.Modifier);
                        if (Int32XmlTranslation.Instance.Parse(
                            node: node,
                            item: out Int32 ModifierParse,
                            errorMask: errorMask))
                        {
                            item.Modifier = ModifierParse;
                        }
